import React from 'react';
import ReactDOM from 'react-dom'
import NavBar from './NavBar';
import Products from './Products';
import Home from './Home';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavBar />
      </header>
      <body>
        <br />
        <Home />
        <hr />
        <Products />
      </body>
      </div>
  );
}

export default App;
